import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import DopComponent from './example';

import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';

class Main extends React.Component{
  render(){
      return <h2>Главная страница</h2>;
  }
}
class Login extends React.Component{
  render(){
      return <h2>страница ввода логина и пароля</h2>;
  }
}
class News extends React.Component{
  render(){
      return <h2>Страница с новостями</h2>;
  }
}
class Profile extends React.Component{
  render(){
      return <h2>страница с производьным тексом </h2>;
  }
}

 ReactDOM.render(
  <Router>
      <Switch>
          <Route exact path="/Main " component={Main} />
          <Route path="/Login" component={Login} />
          <Route path="/News" component={News} />
          <Route path="/Profile" component={Profile} />
      </Switch>
  </Router>,
  document.getElementById("app")
 )




export default function App() {
  return (
    <Router>
      <div>
        <div>
        <Link class = 'li' to="/Main ">Главная</Link>
        <Link class = 'li' to="/Login">Логин</Link>
        <Link class = 'li' to="/News">Новости</Link>
        <Link class = 'li' to="/Profile">Профиль</Link>
        </div>
        <ul>
          <li>
            <button variant="contained" color="secondary">
            <Link class = 'li' to="/dop">DOP</Link>
            </button>
          </li>
        </ul>

        <Switch>
          <Route component={DopComponent} path="/dop" />
        </Switch>
      </div>
    </Router>
  );
}
